import React, {useState} from 'react'
import { ReactComponent as JavaSVG } from '../assets/Java.svg'
import { MorphReplace } from 'react-svg-morph';


import { ReactComponent as SpringIcon} from '../assets/Spring.svg'
import { ReactComponent as JavaIcon} from '../assets/Java.svg'
import { ReactComponent as KotlinIcon} from '../assets/Kotlin.svg'

function Skills2(){
	const [checked, setChecked] = useState(false);


    return(
        <center>
            <div onClick={setChecked(!checked)}>
                <MorphReplace width={400} height={200}>
                    {checked ? <JavaIcon fill="rgba(255,255,255,0.75)" width="400px" height="200px" /> : <KotlinIcon fill="rgba(255,255,255,0.75)" width="400px" height="200px" />}
                </MorphReplace>
            </div>
        </center>
    )
}

export default Skills2
